import logo from '../../assets/images/logo.svg';
import Typography from "@mui/material/Typography";
import Box from "@mui/material/Box";
import InputBase from '@mui/material/InputBase';
import x_button from '../../assets/images/x_button.svg';
import Link from '@mui/material/Link';
import Button from '@mui/material/Button';
import { alpha, styled } from '@mui/material/styles';

export const SignUp = (props) => {
    return (
        <Box sx={{ width: '31.25vw', height: '31.25vw', background: 'white', borderRadius: 'calc(0.1em + 1vw)', position: 'absolute', left: '34.4vw', top: '22.22vh', zIndex: '5', border:"1px solid black", display:"flex", flexDirection:"column", alignItems:"center"}}>
            <Box sx={{display:"flex", alignItems:"flex-end", border:"1px solid black", width:"100%"}}>
                <img className='.login_x_button' src={x_button} onClick={() => props.setRender((oldRender) => !oldRender)}></img>
            </Box>
            <img height="30%" width="auto" src={logo}></img>
            <Button variant='contained' color='secondary'>Create Account</Button>
        </Box>
    )
}
